import { Link } from 'react-router-dom'
import React from "react";
import _ from 'lodash';

class PlanetDetail extends React.Component {
  render() {
    console.log(this.props.match.params.name);
    return;
    const planet = _.find(this.planets, { 'name': this.props.match.params.name });
    console.log(planet);
    return (
          <div className="details">
            <h1>Name: {planet.name}</h1>    
            <h2>Climate: {this.props.planet.climate}</h2>
            <h3>Population: {this.props.planet.population}</h3>
            <h4>Diameter: {this.props.planet.diameter}</h4>
            <h5>Surface Water: {this.props.planet.surface_water}</h5>
            <Link to='/'>Roster</Link>
          </div>
    
      )
  };

  // const planet = _.find(planets, { 'name': props.match.params.name });

  // if (!props.planet) {
  //   return <div>Loading...</div>;
  // }
};


export default PlanetDetail;
